import React from "react";

import './Scoreboard.css'

const Scoreboard = () =>{
    return (
        <div>
            <div id="scoreboard_container">
                <h2 id="scoreboard_title">Scoreboard:</h2>
            </div>
        </div>
    )
}

export default Scoreboard;
